export const SET_CURRENT_RED = "SET_CURRENT_RED";
export const truee = "true";
export const setCurrentBarRed = i => ({ type: SET_CURRENT_RED, index: i, key: truee});

export const SET_CURRENT_BLUE = "SET_CURRENT_BLUE";
export const falsee = "false";
export const setCurrentBarBlue = i => ({ type: SET_CURRENT_BLUE, index: i, key: falsee});
